window.bookSummaryJSON = "<p><b>They call me Emo Barbie. And they're not far off, though I consider myself a little more alternative than that. I just so happen to do everything in six-inch heels and blood-red lipstick.</b></p> <p>I like it when people stare. I like the attention.</p> <p>I've never been drawn to the meek or mild. At least, not until I met Hannah Kate, the journalist hired by Dallin to do a story on <i>Twisted Ink</i> and feature me as its best artist.</p> <p>Even her name screams good girl next door. And that's exactly what she is.</p> <p>Sweet. Innocent. Pure.</p> <p>Everything I'd ruin if I had even a small taste of her.</p> <p>The problem?</p> <p>The two hulking neanderthals she's linked herself to in a surprisingly sexy throuple.</p> <p>Brody and Knox are the epitome of dark, brooding, alphaholes that ooze testosterone and scream bad boy in charge.</p> <p>They're everything I've always competed with as a dominant lesbian. Yet when I see them with her, I'm fascinated.</p> <p>Drawn in and unable to walk away.</p> <p>So tell me why I was a no-strings-attached kind of girl when I met Hannah, determined to use her newly discovered bisexuality to steal her from her men for some fun, yet now I'm aching to fall to my knees and suddenly be a good girl for Brody and Knox with Hannah at my side?</p>"; 
